<script setup>
import {nextTick, ref, onMounted, onUnmounted, computed} from 'vue'
import { useRouter, useRoute, onBeforeRouteUpdate } from 'vue-router'
const router = useRouter()

import gsap from 'gsap'

const svg = ref(null)
onMounted(initTweens)
onMounted(initMouseEvents)

function initTweens() {
	for (let path of svg.value.children) {
	  const delay = Math.random()%0.9;
	  const angle = Math.random()*5;

	  gsap.timeline({
	    scrollTrigger: {
	      trigger: "#allsorts",
	      start: "bottom 80%"
	    }
	  })
	  .from(path, {
	    delay: delay,
	    duration: 0.25,
	    ease: "power1.out",
	    x: 1100,
	  })
	  .from(path, {
	    delay: delay+0.2,
	    transformOrigin: "right",
	    duration: 0.80,
	    ease: "elastic.out(1, 0.5)",
	    rotate: 5
	  }, 0)
	}
}

function initMouseEvents () {
	for (let g of svg.value.children) {
		let hoverTween

		g.addEventListener('mouseenter', () => {
			if (hoverTween) hoverTween.kill()
			hoverTween = gsap.to(g, {
				x: -30,
				duration: 1,
				ease: "elastic.out(1, 0.5)",
			})
		})

		g.addEventListener('mouseleave', () => {
			if (hoverTween) hoverTween.kill()
			hoverTween = gsap.to(g, {
				x: 0,
				duration: 1,
				ease: "elastic.out(1, 0.5)",
			})
		})
	}
}
</script>

